- input: "TEXT\x1CC00411835\x1CX0\x1C\x1CF3A\x1CIn response to your request for additional
    information, the following changes have been made to this report:   Regarding
    the contribution from United Mine Workers of America dated 6/4/2009 in the amount
    of $4,000.00. The July Quarterly Report 2009 (FEC-424258) was amended on 1/24/2011
    to change the election status from the original report of General 2010 to Primary
    2010 due to clerical error.   The contributions made by United Mine Workers of
    America now show a total of $5,000 for the Primary 2010 election and $5,000 total
    for the 2010 General election.  Regarding contributions from organizations not
    registered with the FEC. The report has been amended to show permissible funds
    were used to make contributions from all five unregistered committees due to clerical
    error.   Regarding itemized disbursements with the descriptions ?production costs?
    and ?voter contact.? The report has been amended to show more detailed descriptions
    for each of the disbursements.   The committee has taken steps to ensure that
    future reports accurately reflect all activity for the period.  Please let us
    know if you require any additional information.  \n"
